import React from 'react'
import {Row,Col ,Container} from 'reactstrap'
import ContainerImage from '../images/heroAppContainer.jpg'


const stlyeImage = {
    objectFit : 'cover' ,
    widht : '120w' ,
    maxHeight  :'120vh'

}
const styleDiv = {
    height : "92vh",
    widht : '100%', 

    backgroundImage : ContainerImage
}

const WelcomeBody =  () => {
    return (
        <div style={styleDiv}

        >
            <Row>
                <Col xl = {12}>

                </Col>
            </Row>
        </div>
    )
}

export default WelcomeBody
